import React, { Component } from "react";
import { Form } from 'protected-aidaforms';
import { useParams } from 'react-router-dom'; // import the useParams hook
import json from './InitialEvaluation.js';



export default class Avinum extends Component {
  constructor(props) {
    super(props);
    this.state = {
      Utente: [],
      currentUtente: null,
      currentIndex: -1,
      num_sequencial: null, // add num_sequencial to the state
    };
  }

  componentDidMount() {
    const { num_sequencial } = useParams(); // get the value of num_sequencial from the route parameter
    this.setState({ num_sequencial }, () => {
      this.retrieveUtente(); // call the retrieveUtente method after the state is updated
    });
  }

  retrieveUtente() {
    // use this.state.num_sequencial to retrieve the corresponding Utente
    UtenteDataService.get(this.state.num_sequencial)
      .then(response => {
        this.setState({
          Utente: response.data
        });
        console.log(response.data);
      })
      .catch(e => {
        console.log(e);
      });
  }

  setActiveUtente(Utente, index) {
    this.setState({
      currentUtente: Utente,
      currentIndex: index
    });
  }

  render() {
    // use this.state.num_sequencial and this.state.Utente to construct the reference model
    const { num_sequencial, Utente } = this.state;
    const referenceModel = [
      {
        "itemName": "Número sequencial",
        "item": "num_seq",
        "value": num_sequencial,
        "formVisible": true
      },
      {
        "itemName": "Nome",
        "item": "Nome",
        "value": Utente.nome_utente,
        "formVisible": true
      }
    ];

  
  return (
    <Form
      onSubmit={(values, changedFields) => console.log("SUBMITTED VALUES: ", values, "CHANGED FIELDS: ", changedFields)}
      onSave={(values, changedFields) => console.log("SAVED VALUES: ", values, "CHANGED FIELDS: ", changedFields)}
      onCancel={status => console.log("CANCELLED:", status)}
      template={json}
      dlm={{}}
      showPrint={true}
      editMode={true}
      professionalTasks={["Registar Pedido", "Consultar Pedido", "Anular Pedido"]}
      canSubmit={true}
      canSave={true}
      canCancel={true}
      patientData={{
        "numSequencial": currentUtente.num_sequencial,
        "episodio": 21016848,
        "modulo": "INT",
        "processo": 99998888,
        "nome": currentUtente.nome,
        "dtaNascimento": currentUtente.data_nascimento,
        "idade": 77,
        "sexo": "Masculino"
      }}
      reportData={{
        dtaEncerrada: "22-05-2019 13:02",
        dtaCriada: "10-05-2019 18:47",
        realizada: "Joana Pascoal",
        responsavel: "José Costa"
      }}
      referenceModel={[
        {
          "itemName": "Número mecanográfico",
          "item": "num_mecanografico",
          "value": "123456",
          "formVisible": true
        },
        {
          "itemName": "Número sequencial",
          "item": "num_seq",
          "value": currentUtente.num_sequencial,
          "formVisible": true
        },
        {
          "itemName": "Nome",
          "item": "Nome",
          "value": currentUtente.nome_utente,
          "formVisible": true
        }
      ]}
      submitButtonDisabled={false}
      saveButtonDisabled={false}
    />
  );
};

}
